import React from 'react';
import S from './Profile.module.css'
import iSavva from './../../../Source/Portraits/iSavva.jpg'
import Inf from './Inf/Inf'
import ProfileRoute from './ProfileRoute'; 
import {BrowserRouter, Routes, Route} from "react-router-dom";
const Profile = (props) => 
{
  let profileRoutes = props.Profiles.PrInf.map((elem) => (<Route  exact path={"/Profile/" + elem.id} element={<ProfileRoute name={elem.name}
  interes={elem.interes} about={elem.about} meet={elem.meet} whoFind={elem.whoFind}
   photo={elem.photo} age = {elem.age} city={elem.city} country={elem.country} id={elem.id} key={elem.id}/>}/>))
    return(
      <Routes>
     {profileRoutes}
     </Routes>
    )
}

export default Profile;
